import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
// Material Components
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';

const styles = {
  root: {
    flexGrow: 1,
  },
  grow: {
    flexGrow: 1,
  },
  AppBar: {
    padding: '5px 0',
  }
};

class MenuAppBar extends React.Component {

  render() {
    const { classes } = this.props;
    const logo = '/assets/images/prayerbeads-white.png';

    return (
      <div className={classes.root}>
        <AppBar position="fixed" color="inherit" className={classes.AppBar}>
          <Toolbar>
            <Typography variant="h3" inline={true} color="inherit" align="left" className={classes.grow}>
              Get Your Prayer Beads <img src={logo} alt="logo" width="50" />
              <Typography variant="subtitle2"><em>And other things...</em></Typography>
            </Typography>
          </Toolbar>
        </AppBar>
      </div>
    );
  }
}

MenuAppBar.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(MenuAppBar);
